description:
This chronological account of the events of September 11th offers a visceral, moment-by-moment analysis of the terrorist attacks as witnessed by New Yorkers. Over 100 sources provided real time visual and audio recordings during and after the fall of the Twin Towers, and share their personal stories and recollections of this tragic moment in American history...

